import React from 'react';
import styles from './Slogan.module.css';



function Slogan() {
    return (
        <div className={styles.skill}>
            <div className={styles.icon}>
                <img src="" alt=""/>
            </div>
            <span className={styles.title}>React</span>
           
        </div>

    );
}

export default Slogan;
